import { HttpAuth } from '../../config/Http';
import { changeLoading } from './loading.action';

export function index () {
  const dispatch = useDispatch();

  HttpAuth.get('/item')
    .then( (response) => {
      dispatch({
        type: 'INDEX',
        response
    });
    } )
}
